import '../css/VideoPlayer.css';
import React from 'react';
import video from '../resources/videos/test.m4v'

const VideoPlayer = (props) => {
  return (
      <div id="video-player-wrapper" style={{width: "75%", height: "auto"}}>
        <video src={`${video}`} preload="auto" controls style={{width: "100%", height: "auto"}}/>
      </div>
  );
};

export default VideoPlayer;
